import './NotPlayable.css'
import PropTypes from 'prop-types'
import React, { useEffect, useState } from 'react';

const NotPlayable = ({ card , mat}) => {
    console.log(card)
    console.log(mat)
    const [hideCard, setHideCard] = useState(false)

    useEffect(() => {
        if(card <= mat[0]) {
            console.log(card)
            setHideCard(true)
        } else {
            setHideCard(false)
        }
    }, [card, mat])

    console.log(hideCard)

    return (
        <div className="not_playable">
            {hideCard ? (
                <p></p> 
            ) : (
                <p></p> 
            )}
        </div>
    )
}

NotPlayable.propTypes = {
    card: PropTypes.oneOfType([
        PropTypes.number,
        PropTypes.oneOf([' '])
    ]).isRequired,
    mat: PropTypes.array
};

export default NotPlayable;
